import React from 'react';
import Plot from 'react-plotly.js';

const DataPlot = () => {
    var y0 = [];
    var y1 = [];
    for (var i = 0; i < 50; i ++) {
        y0[i] = Math.random();
        y1[i] = Math.random() + 1;
    }

    return (
        <Plot
          data={[
            {
              x: y0,
              y: y1,
              type: 'box',
              mode: 'lines+markers',
              marker: {color: 'red'},
            }
          ]}
          layout={ {title: 'A Fancy Plot'} }
        />
        
        
      );
}

export default DataPlot;
